ou please fix throughout site and across all pages? It is the same with product titles on product pages (mobile only). </span>------------------ <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #00b050;\">Done!!</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: black; mso-themecolor: text1;\"><br /> *MOBILE- The body font on the product pages are also very small and the selection options of &ldquo;one time purchase&rdquo; vs &ldquo;auto ship&rdquo; part is very small and hard to read and hard to select too because it is so small. </span>------------------ <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #00b050;\">Done!!</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: black; mso-themecolor: text1;\"><br /> *Also cart page font is super small&hellip; the &ldquo;Subtotal&rdquo; and subtotal amount are large, but the product title and everything in that row is very small and hard to read.</span> ------------------ <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #00b050;\">Done!!</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; color: #00b050;\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: black; mso-themecolor: text1;\">4. **Also there is an error on Corey William name. Right now it looks like this : Corey WIlliams when it should be Corey Williams</span><a name=\"_GoBack\"></a> ------------------ <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; color: #00b050;\">Done!!</span></strong></p>\r\n<p class=\"MsoListParagraph\" style=\"text-align: justify;\"><span style=\"color: black; mso-themecolor: text1;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"color: black; mso-themeco