(108, 2, 1327, '121', 0, '09:00', '<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">1.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">They want to modify the search feature so that users can enter in a month (i.e. September) and results will show tour dates for that month</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">Right now, it only works by searching a city</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">or country<span style=\"mso-spacerun: yes;\">&nbsp; </span><span style=\"color: red;\">--- I am working on this.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">2.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">second feature with search is that they want the search text to match only the title and not the description</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">this kind of interferes with the first requirement</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">so it will be searching for titles OR tour months</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">For example, when someone searches \'India\', there might be a description called \'East India River\' in the US.. and they don\'t want that to show</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">So only titles <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #00b050;\">--I have completed this task.</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">3.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">It should say Search by country, city, or month <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #00b050;\">--I have completed this task.</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">4.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">Some titles in the search results begin with the word \'The ....\'</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">This affects the sorting option for results.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">They want to be able to exclude that word so the next word is important in sorting</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">does that make sense?<span style=\"mso-spacerun: yes;\">&nbsp; </span><span style=\"color: red;\">--- I am working on this.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">5.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">link remove on right side bar <strong style=\"mso-bidi-font-weight: normal;\"><span style=\"color: #00b050;\">--I have completed this task.</span></strong></p>\r\n<p>&nbsp;</p>', '2017-09-06 18:30:00', '06:40', '', 'rajesh@kudosta.co', 0, 0, 0),
