(158, 6, 1354, '27', 0, '04:00', '<p>Hello sir,</p>\r\n<p>&nbsp;</p>\r\n<p>The customer would like to make a few changes to the search functionality on the homepage.<br />1) Change \"Materials\" dropdown to now be \"Frame Type\".<br />Options for this dropdown should be : Metal / Plastic / Combination<br />2) Ensure the arrows in the dropdown are functional. Currently, this only works if the words are clicked.<br />3) If choosing \"Gender\" AND/OR \"Frame type\", the \"Model Number\" text-field should be disabled.<br />Similarly, if entering the \"Model Number\", the \"Gender\" and \"Frame type\" dropdown should be disabled.</p>\r\n<p>Please refer to the image attached with shows 1).----------------DONE</p>\r\n<p>&nbsp;</p>\r\n<div class=\"Post__content island\">\r\n<div class=\"styled-content\">\r\n<p>The accessories dropdown should be a select html element on products pages.</p>\r\n<p>Look at the product 6001, for example. Compare the Accessories dropdown, Color dropdown and Select Sizes dropdown.<br />Notice how the Accessories dropdown is a div compared to the other dropdowns which are select html elements with options.</p>\r\n<p>Refer to the image attached which shows this.-------DONE</p>\r\n</div>\r\n</div>', '2017-09-10 18:30:00', '', '', 'rajesh@kudosta.co', 0, 0, 0),
