(239, 14, 1393, '24', 0, '09:00', '<p>Today I worked on These Tasks :-</p>\r\n<p>- 4.) Allow us to add an amount with a description on the side.</p>\r\n<p>Kudosta Reply : Done - wrong amounts if both discount and additional amount are set. Also, when the value is deleted, grand total changes to NaN</p>\r\n<p>Kudosta Reply : Done</p>\r\n<p>5.) Allow us to put a discount with a description on the side</p>\r\n<p>Kudosta Reply : Done - wrong amounts if both discount and additional amount are set. Also, when the value is deleted, grand total changes to NaN</p>\r\n<p>Kudosta Reply : Done</p>\r\n<p>7.) See Sample Formats below:</p>\r\n<p>&nbsp;</p>\r\n<p>Stones:</p>\r\n<p>11889-2 1.44 ct. RB J SI1 GIA 1234567890</p>\r\n<p>&nbsp;</p>\r\n<p>Jewelry: &nbsp;</p>\r\n<p>RN1307D - Diamond Solitaire Ring</p>\r\n<p>14k:White Gold Size: 7</p>\r\n<p>Round</p>\r\n<p>Kudosta Reply : Done</p>\r\n<p>8.) I ordered a size 9 ring size but the Size gave me a size 14</p>\r\n<p>Kudosta Reply : Done</p>\r\n<p>9.) Need Tax computations for all California / CA purchases</p>\r\n<p>Kudosta Reply : Done</p>\r\n<p>10.) Ordered 2 jewelry but there was only one $25 additional charge for the appraisal certificate, appraisal certificate is for every jewelry unless removed by the customer</p>\r\n<p>&nbsp;</p>\r\n<p>11.) There is no Bank Wire discount for Credit Card Purchase</p>\r\n<p>Kudosta Reply : Done</p>', '2017-09-12 18:30:00', '', '', '', 0, 0, 0),
