(274, 2, 1416, '121', 0, '06:00', '<div class=\"gmail_default\" style=\"font-size: large;\">I have completed these task on live site.</div>\r\n<div class=\"gmail_default\" style=\"font-size: large;\">&nbsp;</div>\r\n<div class=\"gmail_default\" style=\"font-size: large;\">1. Enable all RSVP for all travel shows <strong>--Completed.</strong><br />2. We need to add these fields to the RSVP form:&nbsp; <strong>--Completed.</strong><br />- Phone number<br />- Number of attendees<br />They are required<br />3. Change the \'Yes\' button label to \'RSVP\'&nbsp;<strong> --Completed.</strong><br />4.On search results and destination details page, we need to show the month in a different format<br />For example, we need to save \'October\' in DB, but on front end show \'Oct\'.<br />Smaller form of month to save space.<br />We should keep it as full month name in case someone searches for it<br />in the DB&nbsp;<strong> --Completed.</strong></div>\r\n<div class=\"gmail_default\" style=\"font-size: large;\">&nbsp;</div>\r\n<div class=\"gmail_default\" style=\"font-size: large;\">And</div>\r\n<div class=\"gmail_default\" style=\"font-size: large;\">&nbsp;</div>\r\n<div class=\"gmail_default\" style=\"font-size: large;\">Just out of curiousity, I wonder when someone fills out RSVP, where does it go to?<br />Are we able to set a different email address to a different event?<br />just want to double check<br /><br /><strong>I have checked this task. but we have not able to set different email address to different event.</strong></div>', '2017-09-14 18:30:00', '03:10', '', 'rajesh@kudosta.co', 0, 0, 0),
