(372, 5, 1470, '77', 0, '09:00', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">1. Work on calculation on frontend and backend.</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">2 . Please re-arrange the first three fields on the left side of this page as follows:</p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 58.5pt; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level2 lfo1;\"><!-- [if !supportLists]-->a.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Type of Insurance:</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 58.5pt; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level2 lfo1;\"><!-- [if !supportLists]-->b.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Type of Use:</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 58.5pt; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level2 lfo1;\"><!-- [if !supportLists]-->c.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Type of Vehicle:</p>\r\n<p class=\"MsoNormalCxSpFirst\">In other words, I want you to switch places in the layout between Type of Use and Type of Vehicle.</p>\r\n<p class=\"MsoNormalCxSpMiddle\"><strong>Reply :</strong> <span style=\"color: #00b050;\">Done</span></p>\r\n<p class=\"MsoNormalCxSpMiddle\">&nbsp;</p>\r\n<p class=\"MsoNormalCxSpMiddle\">3. Under the field<span style=\"background: yellow; mso-highlight: yellow;\">Vehicle Registration number:</span>, but just above the input box (area highlighted in red), the following instructions should be written, in a slightly smaller font and not bold. &ldquo;Enter &lsquo;n/a&rsquo; if vehicle is not registered.&rdquo; Feel free to use the same font and font size as the text as the words &ldquo;<span class=\"additionalyoungdri\"><span style=\"font-size: 10.0pt; line-height: 115%;\">(under 25 / less than 2 yrs driving experience)</span></span>&rdquo; to the right on the same page under <strong><u>Additional Young Driver</u></strong>.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormalCxSpMiddle\"><strong>Reply :</strong> <span style=\"color: #00b050;\">Done</span></p>', '2017-09-19 18:30:00', '', '', '', 0, 0, 0),
