(436, 14, 1509, '126', 0, '04:00', '<p>Today I worked on these task:-</p>\r\n<p>- System should display the below message when user uploads an incorrect format of the receipt:</p>\r\n<p>\"Only GIF, JPG, PNG and PDF formats are accepted\"</p>\r\n<p>System should allow user to upload only above mentioned receipt formats only.</p>\r\n<p>- System should validate if user has entered correct email address or not when she clicks SUBMIT button on \"Winner Answer\" page.</p>\r\n<div class=\"Post__content island\">\r\n<div class=\"styled-content\">\r\n<p>if user click SUBMIT button without entering a valid email address, System should display message: This field cannot be empty.</p>\r\n<p>if user click on SUBMIT button after entering invalid email address, System should display message: Invalid Email Address.</p>\r\n<p>-&nbsp;Expected: System should display validations for various fields if user has not entered data or has entered invalid data and clicked on SUBMIT button on \"Winner Registration Congratulations\" page.</p>\r\n<p>- &nbsp;On clicking \"Submit\" button, System do not scroll back up to the field for which user has not entered data on Upload page.</p>\r\n<p>for eg: if user has not uploaded the receipt, then on clicking SUBMIT button, System should scroll up to put \"Upload Your Receipt\" button in focus. Similarly for other text fields.</p>\r\n</div>\r\n</div>', '2017-09-24 18:30:00', '02:50', '', 'ravi@kudosta.com', 0, 0, 0),
