tion:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 24.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; color: black; mso-themecolor: text1;\">All on the About page</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Missing a period at the end of &ldquo;Vitamins&rdquo;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Also can you format that sentence as a subheading beneath &ldquo;Made by Doctors For Doctors</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">so right beneath it and make it look like a subheading (so different from body text)</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Also I would love for all headings to be that light/pale green color</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">So all of these to be the light green color:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Also spacing here is off:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">A little too much space between those two sentences</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 24.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; color: black; mso-themecolor: text1;\">join-the-vitabetter-family</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Please make the desyrel quote the light/pale green color and make this part ^^ centered with title please</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">So the quote and the &ldquo;Family is everything&hellip;.together!&rdquo; parts centered on page</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">I would like to see more visual aids and make it look more &ldquo;designful&rdquo;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">I just made this quick mockup so you can get an idea of what I&rsquo;m looking for (however make it look better and be in alignment with branding guide please):<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Who We&rsquo;re Looking For</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Health/nutrition bloggers, vloggers, and social media influencers.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Mommy bloggers who are passionate about health &amp; wellness for their families and families everywhere.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Health conscious, high vibing individuals who are ready to change the planet!! </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Also please add at the very bottom of page, </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">Questions? </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Please contact our amazing Head of Influencer Relations, Jennifer Palhegyi at <span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;</span>Jennifer@getVitaBetter.com. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">*The following is an application form where we would like all submissions to go to jennifer@getvitabetter.com:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">First Name*</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Last Name*</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Email Address*</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Website/Blog*</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Instagram*</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Facebook</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Twitter</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">YouTube</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">Ones with an asterisk (*) next to them are required fields.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\"><br /> </span><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #00b050;\">[JOIN THE FAMILY!] &lt;&lt;Submit form button</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt; text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 24.0pt; line-height: 115%; font-family: \'Arial\',\'sans-serif\'; color: black; mso-themecolor: text1;\">Blog page</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">http://blog.getvitabetter.com/</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 4.5pt;\"><span style=\"color: #00b050;\">FREE SHIPPING </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-lef