(714, 14, 1658, '24', 0, '08:40', '<p>Today I worked these task :-</p>\r\n<p>exl - 20</p>\r\n<p>------</p>\r\n<p>18.) Footer - Change My Account Category list to:</p>\r\n<p>Login</p>\r\n<p>Register</p>\r\n<p>Order Status</p>\r\n<p>Wish List</p>\r\n<p>17.) Footer - Change Customer Service Category list to:</p>\r\n<p>Contact Us</p>\r\n<p>Diamond Education</p>\r\n<p>Shipping Information</p>\r\n<p>Terms &amp; Definitions</p>\r\n<p>16.) Footer - Re-organize Company Info list to:</p>\r\n<p>About Us</p>\r\n<p>Articles</p>\r\n<p>Newsroom</p>\r\n<p>Customer Feedback</p>\r\n<p>15.) Please remove &gt; (greater than sign)</p>\r\n<p>14.) Footer - ABOUT US - please remove info@daimondonnet.com &amp; diammond on net address goes here.</p>\r\n<p>Correct spelling is Sales@DiamondonNet.com</p>\r\n<p>13.) From the footer - remove the following categories</p>\r\n<p>WHY DIAMONDONNET?</p>\r\n<p>DIAMOND INFORMATION</p>\r\n<p>11.) Remove the word See from See Reviews from Customers.</p>\r\n<p>&nbsp;</p>\r\n<p>exl -183</p>\r\n<p>----</p>\r\n<p>2.) Font size is too large cutting off the rest of the&nbsp;</p>\r\n<p>jewelry captions. Please decrease Font size from 18 to 14 or 12. This section should have at least have 120 characters to fit the captions.</p>\r\n<p>&nbsp;</p>\r\n<p>exl -21</p>\r\n<p>----</p>\r\n<p>19.) Footer - Change Tools &amp; Resources Category list to:</p>\r\n<p>Site Map</p>\r\n<p>RSS Videos</p>\r\n<p>Be an Affiliate</p>\r\n<p>Become a Diamond Dealer.</p>\r\n<p>20.) Footer - Change Shopping Help Category list to:</p>\r\n<p>Return Policy</p>\r\n<p>Privacy Statement</p>\r\n<p>Sealed to Go Report</p>\r\n<p>Lifetime Care &amp; Repair.</p>\r\n<p>21.) Header Top link: Browse Category - Change Image relevant to main product like Engagement Rings Jewelry</p>\r\n<p>&nbsp;</p>\r\n<p>exl -44</p>\r\n<p>----</p>\r\n<p>3.) Please Remove \"Welcome to Diamond on Net\" and replace it with Diamond on Net Ideal Cut Selection.</p>\r\n<p>4.) Remove Read Customer Feedback section.</p>\r\n<p>5.) 