o scroll down to see Flouresence, increase the size of the pop-up please</p>\r\n<p>&nbsp;</p>\r\n<p>4.) Diamond Search Result: List View Only - too much empty space.&nbsp; For List view just display all the information and just remove the pop-up info</p>', '2017-10-05 18:30:00', '', '', '', 0, 0, 0),
