(956, 14, 1797, '24', 0, '07:00', '<p>Today I worked on these task :-</p>\r\n<p>-31.) Cushion Shaped Diamonds not showing up in the Results, we had this bug before&nbsp;</p>\r\n<p>All possible values for Cushion Shape is...</p>\r\n<p>Cushion = CB, C, CUX, CU, CMB, CUSH, CUS, CRC, CSC, CX</p>\r\n<p>-&nbsp;Create your Own: Diamond Selection&nbsp; - All shapes should be by default unselected to allow the users to select which Shape/s they desire.&nbsp; and display selected to select on diamondsearchresult1 page.</p>', '2017-10-17 18:30:00', '', '', '', 0, 0, 0),
