(993, 14, 1823, '24', 0, '08:40', '<p>Today I worked on these task :-</p>\r\n<p>1. 1. When you hover your mouse over to \"Gems\", all products in that category should appear.&nbsp; (Just like when you hover your mouse to \"Browse Category)<br />2. Below are the products that should appear under this category.<br />* Complimentary Gemstones<br />* Colored Stone Rings<br />* Colored Stone Earrings<br />* Colored Stone Pendants<br />* Colored Stones Bracelets&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>2. 1. When you hover your mouse over to \"Gift Ideas\", all products in that category should appear.&nbsp; (Just like when you hover your mouse to \"Browse Category)<br />2. Below are the products that should appear under this category.<br />* Under $500<br />* Between $500 - $1000<br />* Over $1000&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>3. 1. When you hover your mouse over to \"Diamond Search\", all products in that category should appear.&nbsp; (Just like when you hover your mouse to \"Browse Category)<br />2. Below are the products that should appear under this category.<br />* Basic Loose Diamond Search<br />* Advance Loose Diamond Search<br />* Ideal Cut Selection<br />* Diamond Education<br />* Matched Diamond Search</p>\r\n<p>4. 1. When you hover your mouse over to \"Engagement\", all products in that category should appear.&nbsp; (Just like when you hover your mouse to \"Browse Category)<br />2. Below are the products that should appear under this category.<br />* Classic Solatire Settings<br />* Settings with Side Stones<br />* Settings with Matching Bands<br />* Three Stones Rings<br />* Create Your own Ring<br />* Pre-Set Engagement Rings</p>\r\n<p>5. Just remove picture.&nbsp; It\'s cleaner and simpler that way.</p>\r\n<p>6. 1. Please change to \"Loose Diamond Seach\" <br />2. Please move the title/header up a little closer the the menu bar.<br />3. Move everything up to.&nbsp; Closer to the title/header.</p>\r\n<p>7. 1.&nbsp; Please move the title/header up.&nbsp;&nbsp; A little closer to the menu bar.<br />2. Move descript up.&nbsp; A little closer to the title/header.<br />3. Move left navigation links and product thumbnails up too.<br />***These are all done to lessen white space.***</p>', '2017-10-23 18:30:00', '', '', '', 0, 0, 0),
(994, 10, 1824, '137', 0, '03:10', '<p>2 logos above need to go into the \'applause\' section</p>\r\n<p>We need to write each name instead of showing a logo</p>\r\n<p>1.The Frankfort Family</p>\r\n<p>2. Fidelity Investments</p>\r\n<p>3. Vertex One Asset Management</p>\r\n<p>4. NEI Investments</p>\r\n<p>5. Dynamic Funds</p>\r\n<p>6. LF Builders</p>\r\n<p>7. Levine Financial Group</p>\r\n<p>Don\'t include the numbers</p>\r\n<p>after that\' well need to make another section called \'Party and Production Sponsors\'</p>\r\n<p>and I will send you all logos to place for that section</p>\r\n<p>&nbsp;</p>\r\n<p>there is just 2 things</p>\r\n<p>The first row of logos \'curtain call\' and \'encore\'.</p>\r\n<p>the logo under curtain call is not really center with the title</p>\r\n<p>and 2. On mobile, the 2 titles stack and then the images stack</p>\r\n<p>it should be title, logo, title, logo</p>\r\n<p>right now its, title, title, logo, logo</p>\r\n<p>this is not your fault, but its better to fix that now</p>\r\n<p>&nbsp;</p>\r\n<p>I have worked above Points in this site today.</p>', '2017-10-23 18:30:00', '01:40', '', '', 0, 0, 0),
