(1134, 19, 1909, '27', 0, '08:30', '<p>Hello Sir ,</p>\r\n<p>Working on the 2 tickets. # 140, 141</p>\r\n<p>1.On some products, like model 6001, there needs to be some padding between each of the accessories fields.Refer to the image attached for clarification.&nbsp; ................done</p>\r\n<p>2. Yes, keep the ultimate member plugin login and register form please. I have made some edits to the Register form so it resembles what we need. Please make the layout according to the colour theme..........done</p>\r\n<p>&nbsp;</p>', '2017-10-30 18:30:00', '03:10', '', 'mahesh@kudosta.com', 0, 0, 0),
(1135, 2, 1910, '125', 0, '09:00', '<p class=\"MsoNormal\">We have done below tasks today.</p>\r\n<p class=\"MsoNormal\">1.&nbsp; do you remember the scrolling thing I asked you to change</p>\r\n<p class=\"MsoNormal\">on S/D page we need to revert it back<strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">2. Next, this is a big one</p>\r\n<p class=\"MsoNormal\">you know the image that needs to be used for the post</p>\r\n<p class=\"MsoNormal\">that gets used on the grid page</p>\r\n<p class=\"MsoNormal\">we need to auto add that to the gallery as well <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">3. alright, we\'ll need to create 3 accounts</p>\r\n<p class=\"MsoNormal\">one for admin, one for the S/D pages, and one for the others</p>\r\n<p class=\"MsoNormal\">so one of each that we will distribute tomorrow</p>\r\n<p class=\"MsoNormal\"><strong>I have changed password for all account and created a new admin account. -Done</strong></p>\r\n<p class=\"MsoNormal\">4. the background for resistance</p>\r\n<p class=\"MsoNormal\">we changed it to barbed wire</p>\r\n<p class=\"MsoNormal\">it has to be fences</p>\r\n<p class=\"MsoNormal\">this was my mistake, I read the instruction wrong <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">5. This is another nasty bug</p>\r\n<p class=\"MsoNormal\">you cannot put &amp; into a title</p>\r\n<p class=\"MsoNormal\">you can, but when you click save, it doesn\'t save the title properly <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">6. alright, the next one is that the save button needs to change color</p>\r\n<p class=\"MsoNormal\">when there are unsaved changes</p>\r\n<p class=\"MsoNormal\">make it any color that stands out so that these people know that the page can be saved with new content <strong>--Done </strong></p>\r\n<p class=\"MsoNormal\">7. Next, the S/D pages need (A-Z) next to title so that users know its a full list without clicking any filter</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Next, change the title of \'Voices of Descendants\' to \'Descendant Profile\'. Do not change the menu item</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">the descendent detail page</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">that is where you change the title</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">not the menu item, and not the page where it lists all the names</p>\r\n<p class=\"MsoNormal\">it is a page with an accordion <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">8. Next, now that we are revering scrolling on S/D pages, we need the add new media button at the top of the \'related media\' box</p>\r\n<p class=\"MsoNormal\">otherwise, you can\'t click it</p>\r\n<p class=\"MsoNormal\">Next, new S/D page starts with 0 media (no placeholders)<strong> --Done</strong></p>\r\n<p class=\"MsoNormal\">9. Next, the tabs on descendant pages are changed to TESTIMONY, INTERVIEW, REMEMBRANCE, REFLECTION <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">10. Next, the titles on S/D pages are in middle section which is fine, but it needs to be left aligned</p>\r\n<p class=\"MsoNormal\">here is an example <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">11. Next, what happened to Images/Videos images? They are placeholders</p>\r\n<p class=\"MsoNormal\">they should be the original images used here</p>\r\n<p class=\"MsoNormal\">when you click on gallery <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<p class=\"MsoNormal\">12. Now that I think about it, we should add a logout button for the special type accounts <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<p class=\"MsoNormal\">13. &amp; in title for the post is not working</p>\r\n<p class=\"MsoNormal\">this is what i did. Create a new post with post title \"Hitler &amp; World War 2\" &gt; you will notice System saves title only as Hitler and not the remainging part of it <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>\r\n<p class=\"MsoNormal\">14. On Survivor page, change it to \"(A-Z)\" on main page when no alphabetical filters are applied. This is working fine on Descendants page -- Done</p>\r\n<p class=\"MsoNormal\">15. For Issue #8, on Survivor page, add some spacing between the + button and the placeholder.</p>\r\n<p class=\"MsoNormal\">Also, please reduce the space below breadcrumbs on both S/D pages. refer this ss&nbsp; <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>', '2017-10-30 18:30:00', '', '', '', 0, 0, 0),
