(1147, 5, 1916, '125', 0, '08:45', '<p>Work on below points :&nbsp;</p>\r\n<p>1.) Next, the S/D pages need (A-Z) next to title so that users know its a full list without clicking any filter --- Done</p>\r\n<p>&nbsp;</p>\r\n<p>2.) Next, change the title of \'Voices of Descendants\' to \'Descendant Profile\'. Do not change the menu item --- Done&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>3.) the descendent detail page that is where you change the title not the menu item, and not the page where it lists all the names it is a page with an accordion&nbsp; --- Done</p>\r\n<p>&nbsp;</p>\r\n<p>4.) Next, now that we are revering scrolling on S/D pages, --- Done</p>\r\n<p>&nbsp;</p>\r\n<p>5.) we need the add new media button at the top of the \'related media\' box otherwise, you can\'t click it . --- Done</p>\r\n<p>&nbsp;</p>\r\n<p>6.) On Survivor page, change it to \"(A-Z)\" on main page when no alphabetical filters are applied.--- Done</p>\r\n<p>&nbsp;</p>\r\n<p>7.) the title should always be visible. it should be static. Currently as i scroll down, the title also scrolls on both S/D page</p>\r\n<p>the title should be always visible. --- Done</p>\r\n<p>&nbsp;</p>\r\n<p>8.) work on &amp; issue when add &amp; in content on 5 templates. --- Done</p>\r\n<p>&nbsp;</p>', '2017-10-30 18:30:00', '07:10', '', 'chetan@kudosta.com', 0, 0, 0),
(1148, 7, 1917, '', 0, '08:20', '<p class=\"MsoNormal\"><strong>https://www.716.com.au/</strong></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">I am trying to find a solution for the lowest price as my existing ticket sales partner has had a price change which has seriously effected our sales.</p>\r\n<p class=\"MsoNormal\">Initially the output I want to achieve is the attached image, which is the narrow template, which will need to be renamed index.php.</p>\r\n<p class=\"MsoNormal\">For some reason the Groupon link for Australia does not work https://partner-int-api.groupon.com/help/division-api#dapi_countries and they have suggested I use</p>\r\n<p class=\"MsoNormal\">https://partner-int-api.groupon.com/deals.json?country_code=AU&amp;tsToken=AU_AFF_0_211609_533_0&amp;utm_source=GPN&amp;utm_medium=afl&amp;utm_campaign=211609&amp;limit=10000</p>\r\n<p class=\"MsoNormal\">Your affiliate ID (211609) has been added already to parameters, and Country codes have been set to Australia (AU) already. If you want to target New Zealand as well, please change AU to NZ where bolded.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">All of this will mean the there are script changes required, will this be more expensive than your previous proposal.</p>\r\n<p class=\"MsoNormal\">worked on ---&gt; Design and Development&nbsp;<strong>Done</strong></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>', '2017-10-30 18:30:00', '', '', '', 0, 0, 0),
