(1150, 13, 1918, '77', 0, '09:00', '<p>1. My client a test and the details in the email are still saying \"Road Side Assist: No\" it should say \"Road Side Assist: Yes\" ------&gt;Done<br /><br />2. Also \"Additional Discount: othersagicor \" in email should say \"Additional Discount: Other Sagicor General Policy\"------&gt;Done<br /><br />3. Don\'t forget: https://url.upwork.com/_01aR-GPFeNbqu5X93egO9ovdN6MNcU4-VO------&gt;Done<br /><br />4. The field \"No Claim Discount\" is throwing the alert. This field is a mandatory field * Please check and test.------&gt;Done<br /><br />5. I asked about the Time Stamp of the records before, they are still 3 hours behind Trinidad and Tobago time, please fix------&gt;Done<br /><br />6. The &ldquo;Type of Insurance&rdquo; field has a direct effect on the drop-down list range displayed for &ldquo;Vehicle Year of &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; Manufacture:. The range displayed based on type of insurance is as follows:<br />&nbsp;&nbsp;&nbsp; 1. Comprehensive : 10 year range, from current year (2017 to 2007).<br /><br />&nbsp;&nbsp;&nbsp; 2. Third Party Fire &amp; Theft: 15 year range, from current year (2017 to 2002).<br /><br />&nbsp;&nbsp;&nbsp; 3. Third Party: 20 year range, from current year (2017 to 1997).&nbsp; ------&gt;Done</p>', '2017-10-30 18:30:00', '', '', '', 0, 0, 0),
