ft:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">1. Simplify the template/page layout for just this article ONLY. No right side bar, no top nav, no search bar...just the FG header and footer --that&rsquo;s it!</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">2. Remove &ldquo;Recommended:&rdquo; link and purple social buttons:</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">3. Add sticky footer - SPECIAL OFFER: As One of Our Readers, You Can Try It FREE. Click Here Now! &lt;&lt;Click thru to sales page</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">4. Add a product image of Better C as well as a CTA button at the bottom that says &ldquo;Get a FREE 30-Day Supply!&rdquo;. Make it look nice! Professional.Here is a screenshot I took from another site that looks nice just as an example:</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">5. Improve formatting of article and text. It is boring grey paragraphs and headers. Let&rsquo;s spice it up and make it look nicer with styling like this one: http://fitnessgoals.com/ketogenic-diet-plan-weight-loss-results-reviews/</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">6. We need at least 10 comments added at the end of the article speaking powerfully, positively about VitaBetter, Liposomal Vitamins being the next revolution in vitamins, other \"basic\" vitamins sucking, Better-C, high-dose vitamin c\'s crazy benefits, anti-cancer, anti-inflammation,etc</span><span style=\"color: #c00000;\">.<span style=\"mso-spacerun: yes;\">&n