(1173, 5, 1933, '125', 0, '08:40', '<p>Work on below points :</p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1.) &nbsp;<span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">the survivor &nbsp;page have a related survivor/person field.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">users need to be able to select the descendant &nbsp;(if on descendant page) and descendant on \"Survivor\" page.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">And they link to the profile of this person.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">So user when starts typing the name of the person, System should automatically fill in the name of the person.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">If the name user enters is not existing, then System should just allow user to save the name in the field on survivor &nbsp;page.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">2.) Relation: There should be a dropdown for relation on Survivor page.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">user should be able to select from following relations:</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">Son, daughter, grandson, granddaughter, son-in-law, daughter-in-law, grandson-in-law, granddaughter-in-law</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">You can separate the Related person name relation with a comma. for eg: Tony Stark, Son</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">The same should be displayed on frontend. Clicking the name will open the user profile.</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">&nbsp;</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">3.)</span> &nbsp;<span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">the descendant &nbsp;page have a related survivor/person field.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">users need to be able to select the survivor (if on descendant page) and descendant on \"Survivor\" page.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">And they link to the profile of this person.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">So user when starts typing the name of the person, System should automatically fill in the name of the person.</span></p>\r\n<p style=\"margin: 0in 0in 7pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">If the name user enters is not existing, then System should just allow user to save the name in the field on survivor &nbsp;page.</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box;\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">4.) Now I\'m going to list a few things that have to be done by EOD#1. The related media section for S/D We need to stop stretching the image and preserve aspect ratio on images</p>\r\n<p class=\"MsoNormal\">the height of these placeholders is fine, we can keep that but just center and preserve aspect ratio</p>\r\n<p class=\"MsoNormal\">5.) &nbsp;Survivor : Biography, &nbsp;Interview, Historical Notes, Related Textual Material, Sources and Credits this is the order of fields for S/D pages</p>\r\n<p class=\"MsoNormal\">6.) Descendant : Biography, Submissions, Related Textual Material, Sources and Credits</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">this is the order of fields for S/D pages</p>', '2017-10-31 18:30:00', '05:30', '', 'chetan@kudosta.com', 0, 0, 0),
