(1256, 5, 1982, '125', 0, '09:00', '<p>Work on below points :</p>\r\n<p>&nbsp;</p>\r\n<p>#3. \"Something that was not captured in our original design was the need to have a status of (deceased) added after a relationship (I only just learned about this from Nancy). If we can edit the list of relationships, we can simply duplicate each relationship with a matching (deceased) version, but ideally there would be a separate status field\"--we have to think about this one. We can have a checkbox or something to mark that the person is deceasedbut how it shows on the front-end may alter the original \'john doe (brother)\'I was thinking \'John Doe - Brother (deceased)\'</p>\r\n<p>--- i have done , bu now working on new requirement</p>', '2017-11-05 18:30:00', '06:30', '', 'chetan@kudosta.com', 0, 0, 0),
(1257, 2, 1983, '125', 0, '09:00', '<p class=\"MsoNormal\">We have done below tasks today.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">1. Touch screen issues:</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">A) Scroll / swipe issue (tkt 129) --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">B) Close box issue (tkt 128) --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">2. pragraph new line issue (tkt 133) --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">3. pdf caption not displayed in popup (tkt 133) --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">6. special kiosk user - login &gt; hide SD pages and set session expiry for 2 years --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">7 when user adds an image in S/D pages, they want it to go to the gallery but hide those specific media types to the public --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">9. image / video popup to show image / video before user save S/D page. Similar to how it is done for pdfs. &nbsp;--Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">10. Remove PDF preview in thumbnails and show pdf gold icon instead of showing preview for the pdf uploaded on S/D page in \"Related Textual Material\" --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">-----------------------------------------------------------</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">#1&nbsp; Lets go over the notes I received/discussed with the client</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">for one, they said \"PDF\'s not resolving correctly. The sample uploaded \"GANZ-ERWIN-LECTURE-VISUALS\" is not being accepted the editor.\"</span> <span style=\"color: #00b050;\">--Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">#4 [non s/d pages] \"Capitalization rules are being imposed on the caption and citations underneath photographs. The capitalization should not be changed from the original text as entered into the media library or the text editor. For example, URL text in a citation in the media library is being capitalized when it appears under a photograph.\" --Done</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">--</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">Can you take a look into this, it appears the editor is changing the case for the text being pasted in there</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">#5. Can we make the columns of names in the Survivor and Descendant registry selection pages a bit wider to minimize wrapping of the names to newlines?</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">--</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\"><span style=\"color: #00b050;\">just make the left column wider (not a lot though) --Done</span></p>', '2017-11-05 18:30:00', '', '', '', 0, 0, 0),
