(1348, 2, 2045, '125', 0, '09:00', '<p><strong>We have done below tasks today.&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1. font size implementation - we need to get this done today for sure&nbsp;</p>\r\n<p>2. pdf thumbnail preview - this can be done now as the library is installed&nbsp;</p>\r\n<p>5. Rajesh every time i open the library popup, it shows \"Upload Files\" page .. can we change it to \"Media Library\" page in library popup to open as default&nbsp;</p>\r\n<p>7. the S/D relation feature shows each name - relation - deceased on a separate line. it needs to be separated by a comma and without breaks&nbsp;</p>\r\n<p>8. the \'related persons\' should link to both to survivors and descendants... this is an adjustment&nbsp;</p>\r\n<p>9. the accordions... if user removes the content from the first accordion.. then the next available accordion item should expand on page load by default</p>\r\n<p>this is similar to the tabs adjustment we made&nbsp;</p>\r\n<p>10. Next, the pdf viewer doesn\'t properly display on the screen</p>\r\n<p>it over extends the bottom of the screen on most screens&nbsp;</p>\r\n<p>11. image / video upload shows error in library&nbsp;</p>\r\n<p>12. related persons to link both S D&nbsp;</p>\r\n<p>13. Comment the code for hiding s/d pages AND the gallery stuff with media&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>we are working on these task.</strong></p>\r\n<p>&nbsp;</p>\r\n<p>3. screensaver&nbsp;</p>\r\n<p>4. css optimization&nbsp;</p>\r\n<p>6. Rajesh, can you open this url in either front or back end. if you click on any image below the video thumbnail, it opens the video in popup. just click on up arrow to see the video and then click on the image below it. -- Completed but we have reverted code.&nbsp;</p>', '2017-11-09 18:30:00', '', '', '', 0, 0, 0),
