(1363, 13, 2054, '125', 0, '09:00', '<p>1.&nbsp; Unequal spacing between slides in Related Media on S/D page --Done</p>\r\n<p>2.&nbsp; next, http://h-kiosk.elitepreviews.com/survivor/anton-adler/<br />survivor page field \'related persons\' is visible even though there are no entries<br />maybe it is the same for descendant pages -- --Done</p>\r\n<p>3.&nbsp; we should underline the name so people know that they can click it -- --Done</p>\r\n<p>4.&nbsp; S/D page to have transparent sides for the slides in Related Media --Done</p>\r\n<p>5.&nbsp; Turn off the auto cycle of the media in Related Gallery on S/D pages --Done</p>\r\n<p>6.&nbsp; Hide Related Persons on S page when no data in it --Done</p>', '2017-11-12 18:30:00', '05:20', '', 'rajesh@kudosta.co', 0, 0, 0),
