(1435, 2, 2093, '125', 0, '08:45', '<p class=\"MsoNormal\">Today we did work on following task<br /><br />1. Delete not working for the pdf thumbnail on S/D pages. <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">2. The logo on homepage when viewed on small screens shows a different image than when viewed on 1920 x 1080 screen as Yousaf mentioned above. <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">3. Also, The logo on homepage is a bit too close to the header menu and is not centered. Manohar knows about this issue. <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">4. PDF viewer is slow to load the pdf document. Can we fasten up this processing to quickly load the pdf in pdf viewer. <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">5. The citation added in pdf is not displayed in current fold when the pdf viewer is opened. I have to scroll the webpage to see the citation for the pdf below the popup. Only the Caption is visible. Can we reduce the pdf viewer popup height to show citation as well below it <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">6. The controls in PDF viewer popup at the top are too small to read and use. Is it possible to enlarge them so that its easy to see / read ? <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">7. Caption / citation below the media popup is too difficult to read because of the background. As per client suggestion, either increase the dimness so that the media caption / citation is easy to read with no background noise OR put a more opaque box underneath the caption / citation so that it is easy to read below the popup. Check issue here: https://drive.google.com/file/d/1IPxhj4eA4Vmx6SSCdwa2_PyDNKxi7RCZ/view</p>\r\n<p class=\"MsoNormal\">You will notice the caption / citation text below popup is not easy to read. <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">8. Change the scroll on global Image / video gallery main pahe (where all images and videos are listed in thumbnails respectively) such that when user reaches the end of the scroll, it show scroll wrap to the beginning / end instead of just making it stop. <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">9. Client wants when user click on edit image / video / pdf on S/D page, System should select the media in the library popup. Currently it opens the library with top / most recently media uploaded. Instead of this, can we have the media selected when user edit it. -- Pending</p>\r\n<p class=\"MsoNormal\">And</p>\r\n<p class=\"MsoNormal\">10. For kiosk user direct login url task <strong>--Done</strong></p>\r\n<p class=\"MsoNormal\">11. Search page and search form on header section <strong>-- Done</strong></p>\r\n<p class=\"MsoNormal\">And Pending task is:</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">So mainly this issue pdf should reset to first page, kiosk user Search icon UI issue, kiosk user S/D links and media, kiosk user direct login, Search touch issue to be done tomorrow<br /><br />Thank you</p>', '2017-11-14 18:30:00', '', '', '', 0, 0, 0),
