(1441, 5, 2097, '125', 0, '08:50', '<p>Work on below points :&nbsp;</p>\r\n<p>1.) Search feature requirements:</p>\r\n<p>&nbsp; &nbsp; 1) Normal user (not logged in), the search in the header is an input field -- Done</p>\r\n<p>&nbsp;</p>\r\n<p>2.) The search feature just shows a grid of boxes (new page) where the search text is contained in any post title and/or content -- Done&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>3.) Change search form functionality --- Done</p>\r\n<p>&nbsp;</p>\r\n<p>4.) Searching in meta fields on search form --- Done</p>', '2017-11-14 18:30:00', '', '', '', 0, 0, 0),
(1442, 7, 2098, '141', 0, '09:00', '<p>The Groupon API for AU now works.&nbsp;&nbsp;</p>\r\n<p>https://partner-int-api.groupon.com/division.json?country_code=AU</p>\r\n<p>&nbsp;</p>\r\n<p>The operation of the Two Drop Down choices \'Select Location\' and Select Category\' is very \'hit and miss\'</p>\r\n<p>&nbsp;</p>\r\n<p>90% of the times when page loads the only box that appears is the \'Choose a city\'</p>\r\n<p>When the site first loads, I have found that selecting any City other that Adelaide mostly returns \'Nothing Found\'</p>\r\n<p>&nbsp;</p>\r\n<p>It also appears that the Groupon Ads need to be sorted by \'Location\' first and then after the page reloads then you need to sort by Category. Often to get the Category sort to woks it requires multiply page refreshes.</p>\r\n<p>&nbsp;</p>\r\n<p>I also have installed the index page at https://www.bwf.com.au</p>\r\n<p>&nbsp;</p>\r\n<p>The php section of the page is very slow to load, I will investigate having the html5 section load and be visible first, then load the PHP section, does this work in your experience.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Done</strong></p>', '2017-11-14 18:30:00', '', '', '', 0, 0, 0),
