(1494, 6, 2128, '125', 0, '09:00', 'Hello sir,\r\nToday we did worked on following points.\r\nA few cosmetic/UI issues that I found while working with the touch screen today:\r\n1. The thumbnail boxes in the gallery view need to shrink the images to fit, preserving the aspect ratio, much like the Related Media Gallery.-----DONE\r\n2. There are cases where there is more caption information than will fit underneath an image, and the top line or two overlays the image. Perhaps the margins for the text area can be made wider to address this, though I can\'t say what the actual character limit should be. For example, go to the Gallery and open the map of Treblinka as can be seen here: https://drive.google.com/open?id=1AR-CbrATmqlTBz3hpiF--35pqR6QdEEm --------DONE\r\n3. There are cases where an original image is so large that when a user touches it, the hover zoom view fills the entire display and there is no way for the user to go back. I believe hover needs to be disabled so that this doesn\'t happen. Here is an example of this happening: https://drive.google.com/open?id=1YOqVgmeO7LQShCai3R2f00NVf01Bz0Uq ------------------DONE\r\n4. And then there is the keyboard. it works fine, but the design has to change--------DOne.\r\n\r\n\r\n\r\n1. The thumbnail boxes in the gallery view need to shrink the images to fit, preserving the aspect ratio, much like the Related Media Gallery.\r\n2. There are cases where there is more caption information than will fit underneath an image, and the top line or two overlays the image. Perhaps the margins for the text area can be made wider to address this, though I can\'t say what the actual character limit should be. For example, go to the Gallery and open the map of Treblinka as can be seen here: https://drive.google.com/open?id=1AR-CbrATmqlTBz3hpiF--35pqR6QdEEm \r\n3. There are cases where an original image is so large that when a user touches it, the hover zoom view fills the entire display and there is no way for the user to go back. I believe hover needs to be disabled so that this doesn\'t happen. Here is an example of this happening: https://drive.google.com/open?id=1YOqVgmeO7LQShCai3R2f00NVf01Bz0Uq \r\n4. And then there is the keyboard. it works fine, but the design has to change.\r\nworking on css issues \r\n', '2017-11-16 18:30:00', '05:20', '', 'rajesh@kudosta.co', 0, 0, 0),
