(1516, 3, 2143, '25', 0, '01:20', '<p><span data-story-id=\"story_3e4750073ead62b58af5a81bc2c35d79\" data-room-id=\"room_a7cdb5edfbfcc2b7acf95a723d637d90\" data-timestamp=\"1511158154159\" data-text=\"Chetan, \r\nSorry it\'s been a while. I got distracted. First for the text import issue. In the attached PDF, the first page shows the imported text and second shows the source from the Online retailer. If this is a problem with the data source being plain text, please let me know.  \r\n\r\nI now have another issue. People are saying I don\'t have enough content. This was confusing, so I checked my Archive page and it isn\'t working properly. It only loads some of the posts and the &quot;Load More&quot; button is not appearing. Example in the PDF. Can you take a look and let me know.  Also every Post has the &quot;This is a custom heading element&quot; displayed, when it should not. Please make it so that is not displayed. \" data-userid=\"794655690783293440\" data-orgid=\"794655691399856128\">Chetan, <br />Sorry it\'s been a while. I got distracted. First for the text import issue. In the attached PDF, the first page shows the imported text and second shows the source from the Online retailer. If this is a problem with the data source being plain text, please let me know. <br /><br />I now have another issue. People are saying I don\'t have enough content. This was confusing, so I checked my Archive page and it isn\'t working properly. It only loads some of the posts and the \"Load More\" button is not appearing. Example in the PDF. Can you take a look and let me know. Also every Post has the \"This is a custom heading element\" displayed, when it should not. Please make it so that is not displayed. </span><img />&nbsp;- Done all issues.</p>', '2017-11-19 18:30:00', '', '', '', 0, 0, 0),
